import FacebookIcon from '@mui/icons-material/Facebook';

export default function Footer() {

    return (
        <footer className="footer">
            <div className="icon">
                render () {
                   <FacebookIcon />
                }
            </div>
            <p>Halal Food Finder 2023. All rights are reserved</p>
        </footer>
    )
}
